import React from 'react';
import Board from './components/Board';
import Card from './components/Card';

function App() {
  return (
    <div className="App">
      <main className="flexbox">
        <Board>
          {' '}
          id="board-1"
          <Card id="card-1" className="card" draggable="true">
            <p>Card one</p>
          </Card>
        </Board>
      </main>
    </div>
  );
}

export default App;
